import React from 'react';
import axios from 'axios';

export default function Memberlist() {
    const [user, setuser] = useState([])
    useEffect(() => {
        axios.get("http://localhost:5000/users/")
        .then(response=>response.data);
    },)
    return (
        <div>
            <h1>Member List</h1>
        </div>
    )
}
